import React from 'react';
import Navbar from 'react-bootstrap/Navbar'
import NavDropdown from 'react-bootstrap/NavDropdown'
import Nav from 'react-bootstrap/Nav'
import {Link} from 'react-router-dom'
import CaseVacanza from '../Pagine/CaseVacanza'
class NavBar extends React.Component {
    
    onClick = (e) => {
        localStorage.clear();
    }

    render() {
        if(localStorage.getItem('logged')) {
            return(
                <Navbar bg="light" expand="lg">
                <Navbar.Brand href="/">Sito Progetto</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <Nav.Link href="/">Home</Nav.Link>
                        <Nav.Link href="/B&B">BnB</Nav.Link>
                        <Nav.Link href="/CaseVacanza">Casa Vacanza</Nav.Link>
                    </Nav>
                        <Nav.Link href="/Autenticazione" onClick = {this.onClick}>ESCI</Nav.Link>
                </Navbar.Collapse>
            </Navbar>
            );
        }
        return(
            <Navbar bg="light" expand="lg">
                <Navbar.Brand href="/">Sito Progetto</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <Nav.Link href="/">Home</Nav.Link>
                        <Nav.Link href="/BnB">BnB</Nav.Link>
                        <Nav.Link href="/CaseVacanza">Casa Vacanza</Nav.Link>
                    </Nav>
                        <Nav.Link href="/Autenticazione">ACCEDI</Nav.Link>
                </Navbar.Collapse>
            </Navbar>
        );
    }
}

export default NavBar;
